  \"NMR data (ppm) from liver cells exposed to surfactant-wrapped (SDS) and oxidized
  (-OH) multi-walled carbon nanotubes (MWCNTs)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-09-26T01:55:14.158829\",\n\t\"name\": \"nmr-data-ppm-from-liver-cells-exposed-to-surfactant-wrapped-sds-and-oxidized-oh-multi-wall\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Carbon nanotubes (CNTs) have great potential
  in industrial, consumer, and mechanical applications, based partly on their unique
  structural, optical and electronic properties. CNTs are commonly oxidized or treated
  with surfactants to facilitate aqueous solution processing, and these CNT surface
  modifications also increase possible human and ecological exposures to nanoparticle-contaminated
  waters. To determine the exposure outcomes of oxidized and surfactant-wrapped multiwalled
  carbon nanotubes (MWCNTs) on biochemical processes, metabolomics based profiling
  of human liver cells (C3A) was utilized. Cells were exposed to 0, 10, or 100 ng/mL
  of MWCNTs for 24 and 48 hr. MWCNT particle size distribution, charge, and aggregation
  were monitored concurrently during exposures. Following MWCNT exposure, cellular
  metabolites were extracted, lyophilized, and buffered for 1H NMR analysis. Acquired
  spectra were subjected to both multivariate and univariate analysis to determine
  the consequences of nanotube exposure on the metabolite profile of C3A cells. Resulting
  scores plots illustrated temporal and dose-dependent metabolite responses to all
  MWCNTs tested. Loadings plots coupled with t-test filtered spectra identified metabolites
  of interest. XPS analysis revealed the presence of hydroxyl and carboxyl functionalities
  on both MWCNTs surfaces. Metal content analysis by ICP-AES indicated that the total
  mass concentration of the potentially toxic impurities in the exposure experiments
  were extremely low (i.e. [Ni] u2264 2 u00d7 10u221210 g/mL). Preliminary data suggested
  that MWCNT exposure causes perturbations in biochemical processes involved in cellular
  oxidation as well as fluxes in amino acid metabolism and fatty acid synthesis. Dose-response
  trajectories were apparent and spectral peaks related to both dose and MWCNT dispersion
  methodologies were determined. Correlations of the significant changes in metabolites
  will help to identify potential biomarkers associated with carbonaceous nanoparticle
  exposure.nnThis dataset is associated with the following publication:nHenderson,
  M., D. Bouchard, X. Chang, S. Al-Abed, and Q. Teng. Biomarker analysis of liver
  cells exposed to surfactant-wrapped and oxidized multi-walled carbon nanotubes (MWCNTs).
  \  SCIENCE OF THE TOTAL ENVIRONMENT. Elsevier BV, AMSTERDAM,  NETHERLANDS, 565:
  777&ndash;786, (2016).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
